const CONFIG = {
  SERVER_URL: 'http://localhost:3001/',
  AUTH_URL: '/auth',
  ACCESS_TOKEN: 'dansdiet-token-storage',
  UI_URL: {
    HOME: '/',
    ERROR: (code) => `/error/${code}`
  },
  DISPLAY_TEXT: {
    ERROR_MESSAGES: {
      AUTH_FAILED: 'authorization failed',
      FORBIDDEN: 'forbidden',
      NOT_FOUND: 'not found',
      UNKNOWN_CODE: 'unknown code',
      NETWORK_ERROR: 'network error'
    }
  }
};

export default CONFIG;
